import React from 'react';
import ReactDOM from 'react-dom';

class Dbconfig extends React.Component {
   
   constructor(){
   		
   		super()
   		this.state = {
   			demo : '',
   			exp  : '',
   			demoerr: '',
   			validdemo: false
   		}
   }

  submitLicense(e){
  		e.preventDefault();
   		if(!this.state.validdemo){
   			this.setState({
   				demoerr:'berr'
   			})
   		}
   		if (this.state.validdemo) 
   		{
	        var data = {"demo":this.state.demo,"exp":this.state.exp}

          // var x = document.getElementsByName('Licence');
          // x[0].submit();
	        $.ajax({
	          type: "POST",
	          data: data,
	          url: Base.Url+"SubmitLicense",
            contentType: "application/json",
	          cache: false,
	            success: function(data){
	            	console.log(data)
	            }.bind(this)
	        });
    	}
  }

  handlLicense(e){
  		this.setState({
			demo : e.target.value.trim()
		})

		if(e.target.value.trim().length==0){
   			this.setState({
   				demoerr:'berr',
   				validdemo:false
   			})
   		}

   		if (e.target.value.trim().length>0) {
			this.setState({
				demoerr:'',
				validdemo:true
			})
   		}
  }

  CreateDemoLicense(e){
  		e.preventDefault();
        $.ajax({
          type: "POST",
          url: Base.Url+"License",
          cache: false,
            success: function(data){
            	this.setState({
              		demo: data.demo,
              		exp : data.exp,
              		demoerr:'',
              		validdemo:true
              	})
            }.bind(this)
        });
  }

   render() {
      return (
         <div className='container'>
            <img 
            	src="data:image/png;base64," 
            	className="img-responsive center-block" ></img>
            <form role="form" className="custom_pad">
    		        <div className="form-group">
    					    <button className="btn btn-lg btn-primary btn-block" 
    							onClick={this.CreateDemoLicense.bind(this)}> Continue Using Free Version </button>
    		        </div>
    		        <div className="form-group">
    					    <input type="text" 
    							className={"form-control " + this.state.demoerr}
    							value={this.state.demo}
    							onChange={this.handlLicense.bind(this)}
    							autoComplete="off"
    							placeholder="Licence Key"></input>
    		        </div>
    		        <div className="form-group">
    					     <button className="btn btn-lg btn-primary btn-block" 
    							 onClick={this.submitLicense.bind(this)}> Next </button>
    		        </div>
    	    </form>
         </div>
      );
   }
}

export default Dbconfig;